import React, { useEffect, useState } from 'react';
import AlumnoService from '../services/AlumnoService';

const AlumnosComponent = () => {
    const [alumnos, setAlumnos] = useState([]);

    useEffect(() => {
        AlumnoService.getAlumnos().then((res) => {
            setAlumnos(res.data);
        });
    }, []);

    return (
        <div className="container">
            <br></br>
            <br></br>
            <div className="card bg-dark rounded-4 ">
                <h2 className="text-center text-white mb-4">Lista de Alumnos</h2>
                <div className="table-responsive">
                    <table className="table table-dark table-borderless text-center border-bottom border-white">
                        <thead>
                            <tr>
                                <th>Rut</th>
                                <th>Apellidos</th>
                                <th>Nombres</th>
                                <th>Fecha de nacimiento</th>
                                <th>Tipo de colegio</th>
                                <th>Nombre del colegio</th>
                                <th>AÃ±o de egreso</th>
                                <th>Arancel</th>
                                <th>Accion</th>
                            </tr>
                        </thead>
                        <tbody>
                            {alumnos.map((alumno) => (
                                <tr key={alumno.rut}>
                                    <td>{alumno.rut}</td>
                                    <td>{alumno.apellidos}</td>
                                    <td>{alumno.nombres}</td>
                                    <td>{alumno.fecha_nacimiento}</td>
                                    <td>{alumno.tipo_colegio}</td>
                                    <td>{alumno.nombre_colegio}</td>
                                    <td>{alumno.ano_egreso}</td>
                                    <td>{alumno.arancel}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    );
};

export default AlumnosComponent;
